import React, { useState, useEffect } from "react";
import { products } from "../server/api";
import "./style.css";
import LogoImg from "../images/Group 19.png";
import ProductList from "./ProductList";
import ipad from "../images/ipad.png";
import note from "../images/note.png";
import oven from "../images/oven.png";
import washing from "../images/washing.png";
import Vector from "../images/Vector.png";
import down from "../images/down.png";

function App() {
  const [productData, setProductData] = useState([]); // 상품 데이터를 저장하는 state
  const [sortBy, setSortBy] = useState("createdAt"); // 정렬 방식을 저장하는 state (기본값은 createdAt)

  useEffect(() => {
    async function fetchData() {
      try {
        // 정렬 방식에 따라 상품 데이터를 가져옴
        const productList = await products(sortBy); // sortBy 값을 전달하여 데이터 가져오기
        setProductData(productList.list); // 가져온 상품 데이터를 상태에 설정
      } catch (error) {
        console.error("Error fetching product data:", error); // 상품 데이터를 가져오는 도중 에러 발생 시 로그 출력
      }
    }
    fetchData();
  }, [sortBy]); // sortBy 값이 변경될 때마다 데이터 다시 불러오기

  // 정렬 방식 변경 시 호출되는 함수
  const handleSortChange = (sortByValue) => {
    setSortBy(sortByValue); // 선택된 정렬 방식으로 sortBy 상태 업데이트
  };

  return (
    <div>
      <div className="top-banner">
        <img src={LogoImg} alt="logoImg" className="panda-logo" />
        <div className="top-banner-menu">자유게시판</div>
        <div className="top-banner-menu">중고마켓</div>
        <button className="login-button">로그인</button>
      </div>
      <div className="main-banner">
        <div className="best-product">
          <h2 className="best-product text">베스트 상품</h2>
          <div className="best-product-container">
            <img src={ipad} alt="ipadImg" className="best-product-img" />
            <img src={note} alt="noteImg" className="best-product-img" />
            <img src={oven} alt="ovenImg" className="best-product-img" />
            <img src={washing} alt="washingImg" className="best-product-img" />
          </div>
        </div>
        <div className="all-product-menu">
          <h2>전체 상품</h2>
          <div className="all-product-right-menu">
            <div className="search-input-container">
              <input
                className="search-input"
                placeholder="검색할 상품을 입력해주세요"
              />
              <img src={Vector} alt="reading-glasses" />
            </div>
            <button className="register-product">상품등록하기</button>
            <div>
              {/* 정렬 방식을 선택할 수 있는 드롭다운 메뉴 */}
              <button onChange={(e) => handleSortChange(e.target.value)}>
                <option value="createdAt">최신순</option>
                <option value="favoriteCount">좋아요순</option>

                <img src={down} alt="down" />
              </button>
            </div>
          </div>
        </div>
        <div className="all-products-img">
          <ProductList products={productData} />
        </div>
      </div>
    </div>
  );
}

export default App;
